import React from 'react'

function Table({states}) {
    return (
        <div className="table">
          {

              states == null? <tr>
              <td><strong>Please select a State to view District data</strong></td>
            <td><strong></strong></td>
          </tr> :
              states.map(state=> (
            <tr>
                <td>{state.name}</td>
              <td><strong>{state.confirmed}</strong></td>
            </tr>
              ))
          }

        </div>
    )
}

export default Table
